    const url = `https://api.openweathermap.org/data/3.0/onecall?lat=${weather.lat}&lon=${weather.lon}&exclude=daily&appid=${token2}&lang=ru&units=metric`;

    useEffect(() => {
        axios.get(url)
            .then(response => {
                setWeather(response.data);
                console.log(response.data);
